import React from 'react';
import { Handle, NodeProps, Position } from 'reactflow';
import defaultNodes from './DnDFlowPro'


export default () => {
  const onDragStart = (event, nodeType,label,defaultNodes,shapeName) => {
    event.dataTransfer.setData('application/reactflow', nodeType);
    event.dataTransfer.setData("label", label);
    event.dataTransfer.setData("shapeName",shapeName);
    event.dataTransfer.effectAllowed = 'move';
  };
  
  return (
    <aside>
      <div className="description">You can drag these nodes to the pane on the right.</div>
      <h3>Source</h3>
      <div className="dndnode"  onDragStart={(event) => onDragStart(event, "shape", 'start',"round-rect")} draggable>
        Source 1
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event,  "shape",'end')} draggable>
        Source 2
      </div>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, "shape", 'output')} draggable>
      Source 3
      </div>
      <h3>Processor</h3>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, "shape", 'output')} draggable>
      Processor
      </div>
      <h3>Destination</h3>
      <div className="dndnode" onDragStart={(event) => onDragStart(event, "shape" ,'output')} draggable>
        Node 4
      </div>
     
      

    </aside>
  );
};
